INSERT INTO `adminnotification_inbox` VALUES (1,1,'2016-03-29 16:24:35','Magento Community Edition 2.0.3 Includes Functional and Security Updates – 3/30/2016','Magento Community Edition 2.0.3 is now available and contains important security updates, as well as performance improvements and functional enhancements. Full details on the functional enhancements are included in the release notes at http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.3CE.html. More information on the security updates can be found on the Magento Security Center at https://magento.com/security/patches/magento-203-security-update.','https://magento.com/security/patches/magento-203-security-update',1,0),(2,1,'2016-03-30 22:40:23','New Release: Magento Community Edition 2.0.4 – 3/31/2016','We have released Magento Community Edition 2.0.4 to address a packaging issue with yesterday’s release. If you have already installed Enterprise Edition 2.0.3, you must replace it with the new version to ensure that your site receives all security enhancements. Learn more at https://magento.com/security/patches/magento-204-security-update','https://magento.com/security/patches/magento-204-security-update',1,0),(3,4,'2017-01-19 06:59:15','New Magento DevBox Beta Speeds Magento 2 Setup – 1/19/2017','Magento DevBox Beta makes it faster and easier than ever to setup your Magento 2 development environment. Read our blog post to find out more at: https://magento.com/blog/technical/set-your-magento-2-development-environment-faster.','https://magento.com/blog/technical/set-your-magento-2-development-environment-faster',1,0),(4,1,'2017-02-07 10:02:30','Community Editions 2.1.4 and 2.0.12 Resolve Zend Framework Security Issue & Enhance Product Quality – 2/7/2017','Community Editions 2.1.4 and 2.0.12 address the recent Zend Framework 1 security vulnerability and improve catalog, payments, and sales modules. Review the release notes for more information:  http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',1,0),(5,4,'2017-02-17 11:09:01','Inspirational athlete, Serena Williams, will join Magento at Imagine 2017.','Imagine 2017 will bring together 3000+ international commerce experts to exchange ideas on the future of commerce. Don’t miss this opportunity to hear from inspirational athlete, Serena Williams, and Stella & Dot CEO, Jessica Herrin. Join us in Las Vegas, April 3-5. Register now at https://imagine.magento.com/\n','https://imagine.magento.com/',1,0),(6,4,'2017-02-21 07:06:57','Community Editions 2.1.5 and 2.0.13 Update Magento Copyright – 2/21/2017','Community Editions 2.1.5 and 2.0.13 contain 2017 copyright updates. That’s it. Nothing else. Isolating these changes in a single release is intended to simplify future updates and developer workflow. For more information, please review the release notes:   http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html.','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',1,0),(7,4,'2017-12-12 20:00:41','Magento Open Source 2.2.2 Accelerates Growth with Instant Purchase Checkout, Integrated Email Marketing Automation, Advanced Reporting, and More – 12/12/2017','Our newest release of Magento Open Source equips merchants with powerful tools to accelerate growth and improve operational efficiency. It boosts conversion rates with a streamlined Instant Purchase checkout, jump-starts sales with integrated dotmailer email marketing automation, delivers actionable insights through Advanced Reporting, and provides integrated multi-carrier shipping and fulfillment capabilities with Magento Shipping. https://magento.com/blog/magento-news/new-instant-purchase-checkout-boosts-sales ','https://magento.com/blog/magento-news/new-instant-purchase-checkout-boosts-sales ',0,0),(8,4,'2017-12-17 23:53:44','Survey: Do you use site personalization and optimization tools? If yes, we\'d to hear from you!','We\'d like to invite you to take our online survey on site personalization and optimization tools. Your input is valuable and will help to inform the products we bring to market.\n\nThe survey should take no more than 5 minutes to complete. \n\nTo get started, go to: \nhttps://www.surveymonkey.com/r/NF9ZH8D\n\nThank you in advance for your participation.','https://www.surveymonkey.com/r/NF9ZH8D',0,0);
