and scratches from reaching lens elements.</li>\r\n<li>Constructed from Schott glass for optical clarity.</li>\r\n<li>F-Pro brass filter ring helps to prevent jamming and provides additional strength.</li>\r\n<li>Plastic case included for storage and transport.</li>\r\n</ul>\r\n<p>This filter fulfills the desire of many photographers for pure lens protection without a filter effect. Its only function is to keep elements such as dirt, sand, or splashes away from the front lens.<br/><br>The B+W UV Haze MRC 010M Filter is a general use, clear filter designed to absorb ultraviolet light and reduce the bluish cast of daylight. Aside from the reduction of unwanted blue casts, no additional coloration or contrast is created, and adjustments to exposure are not required while using this filter. To prevent internal ghosting and reflections while providing over 99.8% light transmission, each glass surface includes eight layers of anti-reflection coating. This Multi-Resistant Coating (MRC) also offers greater protection to the filter substrate and helps it to stay clean for longer than with uncoated filters.<br><br>B+W filters are constructed from Schott glass for increased optical clarity and color fidelity. This filter features an F-Pro brass filter ring for durability as well as jamming prevention.</p>');
