 MRC 010M Filter is a general use, clear filter designed to absorb ultraviolet light and reduce the bluish cast of daylight. Aside from the reduction of unwanted blue casts, no additional coloration or contrast is created, and adjustments to exposure are not required while using this filter. To prevent internal ghosting and reflections while providing over 99.8% light transmission, each glass surface includes eight layers of anti-reflection coating. This Multi-Resistant Coating (MRC) also offers greater protection to the filter substrate and helps it to stay clean for longer than with uncoated filters.<br><br>B+W filters are constructed from Schott glass for increased optical clarity and color fidelity. This filter features an F-Pro brass filter ring for durability as well as jamming prevention.</p>',2,0,'/f/i/file_2.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'B+W UV Haze MRC 010M','2017-12-15 03:32:20',NULL,'/f/i/file.jpg',39.9900,NULL,NULL,0,NULL,'010M',NULL,'/f/i/file_2.jpg',NULL,'2017-12-15 00:00:00',20.9900,'2017-12-31 00:00:00','/f/i/file.jpg',2,'/f/i/file_2.jpg',NULL,'2017-12-15 09:11:11','b-w-uv-haze-mrc-010m',NULL,4,1.0000,NULL);
