INSERT INTO `cms_block` VALUES (1,'Footer column content 2','footer_col_2','<ul>\r\n    <li><a href=\"{{store direct_url=\"about-us\"}}\">About Us</a></li>\r\n    <li><a href=\"{{store direct_url=\"customer-service\"}}\">Customer Service</a></li>\r\n    <li><a href=\"{{store direct_url=\"privacy-policy\"}}\">Privacy Policy</a></li>\r\n    <li><a href=\"{{store direct_url=\"contact\"}}\">Contact Us</a></li>\r\n</ul>\r\n\r\n','2016-03-11 21:30:44','2017-12-13 09:06:58',1),(4,'Footer column content 3','footer_col_3','<h4>Why Buy Us</h4>\r\n<div class=\"footer-col-content\">\r\n    <ul>\r\n        <li><a href=\"{{store url=\"\"}}return-exchange\">Return & Exchange</a></li>\r\n        <li><a href=\"{{store url=\"\"}}secure-shopping\">Secure Shopping</a></li>\r\n        <li><a href=\"{{store url=\"\"}}shipping-tracking\">Shipping & Tracking</a></li>\r\n    </ul>\r\n</div>','2016-03-11 21:33:05','2017-12-13 09:17:20',1),(7,'Footer column content 4','footer_col_4','<div class=\"footer-col\">\r\n    <h4>By Brands:</h4>\r\n    <div class=\"footer-col-content\">\r\n        <ul>\r\n            <li><a href=\"{{store url=\'\'}}b-w.html\">B＋W</a></li>\r\n            <li><a href=\"{{store url=\'\'}}hoya.html\">Hoga</a></li>\r\n            <li><a href=\"{{store url=\'\'}}hoya-hd.html\">Hoga HD</a></li>\r\n            <li><a href=\"{{store url=\'\'}}tiffen.html\">Tiffen</a></li>\r\n        </ul>\r\n    </div>\r\n</div>\r\n','2016-03-11 21:35:20','2017-12-13 09:21:55',1),(21,'Banners','banner_block','<div class=\"banners\">\r\n	<ul class=\"row\">\r\n		<li class=\"banner-1 col-md-6\">\r\n			<div class=\"banner\">\r\n				<img src=\"{{view url=\'images/ban-1.jpg\'}}\" alt=\"banner-image\">\r\n				<div class=\"banner-1_txt_wrap\">\r\n					<div class=\"banner-1_txt wow bounceInLeft\" data-wow-delay=\'300\' data-wow-offset=\'100\'>\r\n						<span>get an extra<br>20% off<br>first order</span>\r\n						<a href=\"{{store url}}\">Learn More</a>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</li>\r\n		<li class=\"banner-2 col-md-6\">\r\n			<div class=\"banner\">\r\n				<a href=\"{{store url}}\">\r\n					<img src=\"{{view url=\'images/ban-2.jpg\'}}\" alt=\"banner-image\">\r\n				</a>				\r\n			</div>\r\n		</li>\r\n	</ul>\r\n</div>','2017-05-17 08:51:55','2017-12-12 09:58:18',1),(22,'Additional information','add-info','<div class=\"add-info\">\r\n	<ul class=\"row\">\r\n		<li class=\"col-lg-3 col-sm-6\">\r\n			<i class=\"material-icons-local_phone\"></i>\r\n			<div class=\"add-info_txt\">\r\n				<h4><a href=\"{{store url}}mac.html\">+3(800) 2345-6789</a></h4>\r\n				<span>Round-the-clock free hotline (24/7)</span>\r\n			</div>\r\n		</li>\r\n		<li class=\"col-lg-3 col-sm-6\">\r\n			<i class=\"material-icons-local_shipping\"></i>\r\n			<div class=\"add-info_txt\">\r\n				<h4><a href=\"{{store url}}mac.html\">Free Shipping</a></h4>\r\n				<span>We provide you with fast and free delivery regardless of the product size and value.</span>\r\n			</div>\r\n		</li>\r\n		<li class=\"col-lg-3 col-sm-6\">\r\n			<i class=\"material-icons-replay\"></i>\r\n			<div class=\"add-info_txt\">\r\n				<h4><a href=\"{{store url}}tablets2.html\">Return & Exchange</a></h4>\r\n				<span>You can return or exchange the item within 14 days.</span>\r\n			</div>\r\n		</li>\r\n		<li class=\"col-lg-3 col-sm-6\">\r\n			<i class=\"material-icons-thumb_up\"></i>\r\n			<div class=\"add-info_txt\">\r\n				<h4><a href=\"{{store url}}networking.html\">Satisfaction Guarantee</a></h4>\r\n				<span>We are committed to your satisfaction with every order.</span>\r\n			</div>\r\n		</li>\r\n	</ul>\r\n</div>','2017-05-18 09:01:36','2017-05-25 06:45:09',1),(24,'Footer column content 1','footer_col_1','<img src=\"{{view url=\'images/footer_logo.png\'}}\" alt=\"cameraeplus\" class=\"logo-light\">\r\n<p class=\"footer-info\">Get the power to do more your way. Whether you\'re a gamer, a designer, a student or parent, a writer, a dealmaker, or a Jack or Jill of all trades – at the CompShop you\'ll find the perfect PCs for all that you do. Explore our collection by type – and discover devices that can make every project your best.</p>','2017-05-18 23:12:39','2017-12-13 06:47:08',1),(25,'Contact info','contact_info','<div class=\"contact-info\">\r\n   	<address class=\"contact-info_address\">\r\n   		<dl>\r\n   			<dt>\r\n   				<span class=\"icon-room\"></span>\r\n   			</dt>\r\n   			<dd>Northwich, CW8 1BE</dd>\r\n   		</dl>\r\n		<dl>\r\n			<dt>\r\n				<span class=\"icon-time\"></span>\r\n			</dt>\r\n			<dd>7 days a week from 9:00 am to 7:00 pm</dd>	\r\n		</dl>\r\n		<dl>\r\n			<dt>\r\n				<span class=\"icon-email\"></span>\r\n			</dt>\r\n			<dd>\r\n				<span class=\"contact-info_mail\"><a href=\"mailto:info@demolink.org\">info@demolink.org</a></span>\r\n			</dd>\r\n		</dl>\r\n   	</address>\r\n</div>','2017-05-18 23:46:25','2017-12-14 02:01:42',1),(26,'Payment','payment_1','<ul class=\"list-inline list-payment\">\r\n	<li><span class=\"icon-visa\"></span></li>\r\n	<li><span class=\"icon-mastercard\"></span></li>\r\n	<li><span class=\"icon-paypal\"></span></li>\r\n	<li><span class=\"icon-discover\"></span></li>\r\n	<li><span class=\"icon-stripe\"></span></li>\r\n</ul>','2017-05-19 00:42:43','2017-12-14 01:55:10',1),(27,'Footer column 2 title','footer_col_2_title','<h4>Information</h4>','2017-05-19 01:53:01','2017-05-21 21:35:22',1),(28,'底部附加信息','footer-add-info','<div class=\"add-info\">\r\n	<ul class=\"row\">\r\n    	<li class=\"col-lg-3 col-sm-6\">\r\n        	<i class=\"icon-shipping\"></i>\r\n            <div class=\"addinfo-text\">\r\n            	<h4>FREE SHIPPING</h4>\r\n                <span>Orders Over $59.00</span>\r\n            </div>\r\n        </li>\r\n        <li class=\"col-lg-3 col-sm-6\">\r\n        	<i class=\"icon-huanhuo\"></i>\r\n            <div class=\"addinfo-text\">\r\n            	<h4>RETURN &amp; EXCHANGE</h4>\r\n                <span>Within 90 days</span>\r\n            </div>\r\n        </li>\r\n        <li class=\"col-lg-3 col-sm-6\">\r\n        	<i class=\"icon-zhibao\"></i>\r\n            <div class=\"addinfo-text\">\r\n            	<h4>PAYMENT</h4>\r\n                <span>100% Secure</span>\r\n            </div>\r\n        </li>\r\n        <li class=\"col-lg-3 col-sm-6\">\r\n        	<i class=\"icon-manyi\"></i>\r\n            <div class=\"addinfo-text\">\r\n            	<h4>Satisfaction Guarantee</h4>\r\n                <span>satisfaction with every order</span>\r\n            </div>\r\n        </li>\r\n    </ul>\r\n</div>','2017-12-13 00:55:14','2017-12-14 01:40:31',1),(29,'BW_catelog_catetory_view_banner','BW_catelog_catetory_view_banner','<div class=\"catetory-banner cover\" style=\"background-image:url({{media url=\'wysiwyg/catelog_catetory_banner.jpg\'}})\"></div>','2017-12-15 05:49:24','2017-12-15 06:58:56',1);
