INSERT INTO `cms_page` VALUES (1,'404 Not Found','1column','Page keywords','Page description','no-route','Whoops, our bad...','<div class=\"not-found-page\">\r\n    <dl>\r\n        <dt class=\"not-found-page_top\">\r\n            <img src=\"{{view url=\'images/404.png\'}}\" alt=\"404-img\">\r\n            <div>\r\n                <strong>Sorry...</strong>\r\n                <span>It’s not you. It’s us.</span>\r\n            </div>\r\n        </dt>\r\n    </dl>\r\n    <dl class=\"not-found-page_bottom\">\r\n        <dt>The page you are looking for can’t be found.</dt>\r\n        <dd><a href=\"{{store url=\"\"}}\">Go Home!</a></dd>\r\n    </dl>\r\n</div>','2016-03-11 20:24:45','2017-01-19 07:33:44',1,0,'',NULL,NULL,NULL,NULL,NULL,''),(2,'Home page','1column','','','home','','','2016-03-11 20:24:45','2017-12-08 03:03:18',1,0,'<!--\r\n    <referenceContainer name=\"right\">\r\n        <action method=\"unsetChild\"><argument name=\"alias\" xsi:type=\"string\">right.reports.product.viewed</argument></action>\r\n        <action method=\"unsetChild\"><argument name=\"alias\" xsi:type=\"string\">right.reports.product.compared</argument></action>\r\n    </referenceContainer>-->',NULL,NULL,NULL,NULL,NULL,''),(3,'Enable Cookies','1column',NULL,NULL,'enable-cookies','What are Cookies?','<div class=\"enable-cookies cms-content\">\r\n<p>\"Cookies\" are little pieces of data we send when you visit our store. Cookies help us get to know you better and personalize your experience. Plus they help protect you and other shoppers from fraud.</p>\r\n<p style=\"margin-bottom: 20px;\">Set your browser to accept cookies so you can buy items, save items, and receive customized recommendations. Here’s how:</p>\r\n<ul>\r\n<li><a href=\"https://support.google.com/accounts/answer/61416?hl=en\" target=\"_blank\">Google Chrome</a></li>\r\n<li><a href=\"http://windows.microsoft.com/en-us/internet-explorer/delete-manage-cookies\" target=\"_blank\">Internet Explorer</a></li>\r\n<li><a href=\"http://support.apple.com/kb/PH19214\" target=\"_blank\">Safari</a></li>\r\n<li><a href=\"https://support.mozilla.org/en-US/kb/enable-and-disable-cookies-website-preferences\" target=\"_blank\">Mozilla/Firefox</a></li>\r\n</ul>\r\n</div>','2016-03-11 20:24:45','2016-03-11 20:24:45',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,'Privacy Policy','1column','','','privacy-policy-cookie-restriction-mode','Privacy Policy','<div class=\"change-message\">\r\n    <span>Please replace this text with your Privacy Policy.</span>\r\n</div>\r\n<dl class=\"custom-page privacy-policy-page\">\r\n    <dt class=\"heading-2\">General information</dt>\r\n    <dd>Welcome to our Privacy Policy page! When you use our store services, you trust us with your information. This Privacy Policy is meant to help you understand what data we collect, why we collect it, and what we do with it. When you share information with us, we can make our services even better for you. For instance, we can show you more relevant search results and ads, help you connect with people or to make sharing with others quicker and easier. As you use our services, we want you to be clear how we’re using information and the ways in which you can protect your privacy. This is important; we hope you will take time to read it carefully. Remember, you can find controls to manage your information and protect your privacy and security. We’ve tried to keep it as simple as possible.</dd>\r\n    <dt class=\"heading-2\">Right to access, correct and delete data and to object to data processing</dt>\r\n    <dd>Our customers have the right to access, correct and delete personal data relating to them, and to object to the processing of such data, by addressing a written request, at any time. The Company makes every effort to put in place suitable precautions to safeguard the security and privacy of personal data, and to prevent it from being altered, corrupted, destroyed or accessed by unauthorized third parties. However, the Company does not control each and every risk related to the use of the Internet, and therefore warns the Site users of the potential risks involved in the functioning and use of the Internet. The Site may include links to other web sites or other internet sources. As the Company cannot control these web sites and external sources, the Company cannot be held responsible for the provision or display of these web sites and external sources, and may not be held liable for the content, advertising, products, services or any other material available on or from these web sites or external sources.</dd>\r\n    <dt class=\"heading-2\">Management of personal data</dt>\r\n    <dd>You can view or edit your personal data online for many of our services. You can also make choices about our collection and use of your data. How you can access or control your personal data will depend on which services you use. You can choose whether you wish to receive promotional communications from our store by email, SMS, physical mail, and telephone. If you receive promotional email or SMS messages from us and would like to opt out, you can do so by following the directions in that message. You can also make choices about the receipt of promotional email, telephone calls, and postal mail by visiting and signing into Company Promotional Communications Manager, which allows you to update contact information, manage contact preferences, opt out of email subscriptions, and choose whether to share your contact information with our partners. These choices do not apply to mandatory service communications that are part of certain store services.</dd>\r\n    <dt class=\"heading-2\">Information We Collect</dt>\r\n    <dd>Our store collects data to operate effectively and provide you the best experiences with our services. You provide some of this data directly, such as when you create a personal account. We get some of it by recording how you interact with our services by, for example, using technologies like cookies, and receiving error reports or usage data from software running on your device. We also obtain data from third parties (including other companies). For example, we supplement the data we collect by purchasing demographic data from other companies. We also use services from other companies to help us determine a location based on your IP address in order to customize certain services to your location. The data we collect depends on the services and features you use.</dd>\r\n    <dt class=\"heading-2\">How We Use Your Information</dt>\r\n    <dd>Our store uses the data we collect for three basic purposes: to operate our business and provide (including improving and personalizing) the services we offer, to send communications, including promotional communications, and to display advertising. In carrying out these purposes, we combine data we collect through the various store services you use to give you a more seamless, consistent and personalized experience. However, to enhance privacy, we have built in technological and procedural safeguards designed to prevent certain data combinations. For example, we store data we collect from you when you are unauthenticated (not signed in) separately from any account information that directly identifies you, such as your name, email address or phone number.</dd>\r\n    <dt class=\"heading-2\">Sharing Your Information</dt>\r\n    <dd>We share your personal data with your consent or as necessary to complete any transaction or provide any service you have requested or authorized. For example, we share your content with third parties when you tell us to do so. When you provide payment data to make a purchase, we will share payment data with banks and other entities that process payment transactions or provide other financial services, and for fraud prevention and credit risk reduction. In addition, we share personal data among our controlled affiliates and subsidiaries. We also share personal data with vendors or agents working on our behalf for the purposes described in this statement. For example, companies we\'ve hired to provide customer service support or assist in protecting and securing our systems and services may need access to personal data in order to provide those functions. In such cases, these companies must abide by our data privacy and security requirements and are not allowed to use personal data they receive from us for any other purpose. We may also disclose personal data as part of a corporate transaction such as a merger or sale of assets.</dd>\r\n</dl>','2016-03-11 20:24:45','2017-01-06 04:46:51',1,0,'',NULL,NULL,NULL,NULL,NULL,''),(6,'Customer Service','1column','','','customer-service','Customer Service','<div class=\"customer-service\">\r\n    <div class=\"text-block customer-service__block\">\r\n        <h3>Delivery</h3>\r\n        <h4>Hello and welcome to the shipping and delivery information page! Here you can get acquainted with useful information on terms \r\nand conditions of our goods delivery</h4>\r\n        <p>You can purchase your items online and pick them up at our street store, or ship them directly to your doorstep. Shipping is free on some orders. We use the best carriers in the business to make sure your order gets to you on time. From the Secure Checkout page you\'ll see your item description, price and delivery timing. Where available, you can also choose a faster delivery method for each item on your order, for an additional fee. Delivery times vary according to your selected delivery address, availability of your items and the time of day you place your order.</p>\r\n    </div>\r\n    <div class=\"table-block  customer-service__block\">\r\n        <h3>Cost</h3>\r\n        <div class=\"table-block_wrapper\">\r\n            <table>\r\n                <thead>\r\n                    <th>Services</th>\r\n                    <th>Locations</th>\r\n                    <th>Delivery Schedule</th>\r\n                    <th>Cost Per Shipment</th>\r\n                </thead>\r\n                <tbody>\r\n                    <tr>\r\n                        <td>Royal mail 1st Class Service (Order value $20 or less)</td>\r\n                        <td>All of UK & some European Countries</td>\r\n                        <td>1-3 days Monday - Saturday</td>\r\n                        <td>$5</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Royal mail Tracker (Order value $50 or less)</td>\r\n                        <td>All of UK</td>\r\n                        <td>1-3 days Delivery 7.30am - 5.30am Monday - Friday</td>\r\n                        <td>$45</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Standard Courier Delivery</td>\r\n                        <td>UK mainland only</td>\r\n                        <td>1-3 days Monday - Saturday</td>\r\n                        <td>$124</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Standard Courier Delivery</td>\r\n                        <td>Northern Ireland, Eire, Scilly Isles</td>\r\n                        <td>1-3 days Delivery 7.30am - 5.30am Monday - Friday</td>\r\n                        <td>$11</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Royal mail 1st Class Service (Order value $20 or less)</td>\r\n                        <td>All of UK & some European Countries</td>\r\n                        <td>1-3 days Monday - Saturday</td>\r\n                        <td>$5</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Priority courier pre 12pm Next Working Day</td>\r\n                        <td>UK mainland only</td>\r\n                        <td>1-3 days Delivery 7.30am - 5.30am Monday - Friday</td>\r\n                        <td>$89</td>\r\n                    </tr>\r\n                    <tr>\r\n                        <td>Royal mail 1st Class Service (Order value $20 or less)</td>\r\n                        <td>All of UK & some European Countries</td>\r\n                        <td>1-3 days Monday - Saturday</td>\r\n                        <td>$72</td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>            \r\n        </div>\r\n    </div>\r\n    <div class=\"text-block  customer-service__block\">\r\n        <h3>Free Delivery</h3>\r\n        <p>Free two-day shipping is available on in-stock items. You can see in your bag if your item is in stock. Free two-day shipping is not available on customized, engraved products, and for certain order types, including orders paid for with financing or by bank transfer. To get free two-day shipping, you will need to place your order by 5pm, Monday to Friday. For instance, if you order your goods before 5:00 pm, Monday to Friday we will deliver them in two business days.</p>\r\n    </div>\r\n    <div class=\"list-block  customer-service__block\">\r\n        <h3>Terms & Conditions</h3>\r\n        <ul class=\"row\">\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Entire agreement</h4>\r\n                <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n            <li class=\"col-md-6\">\r\n                <h4>Controlling terms</h4>\r\n                <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller.</p>\r\n            </li>\r\n        </ul>\r\n    </div>\r\n</div>\r\n\r\n<script>\r\nvar headertext = [];\r\nvar headers = document.querySelectorAll(\".table-block thead\");\r\nvar tablebody = document.querySelectorAll(\".table-block tbody\");\r\n\r\nfor (var i = 0; i < headers.length; i++) {\r\n    headertext[i]=[];\r\n    for (var j = 0, headrow; headrow = headers[i].rows[0].cells[j]; j++) {\r\n      var current = headrow;\r\n      headertext[i].push(current.textContent);\r\n      }\r\n} \r\n\r\nfor (var h = 0, tbody; tbody = tablebody[h]; h++) {\r\n    for (var i = 0, row; row = tbody.rows[i]; i++) {\r\n      for (var j = 0, col; col = row.cells[j]; j++) {\r\n        col.setAttribute(\"data-th\", headertext[h][j]);\r\n      } \r\n    }\r\n}\r\n</script>','2016-03-11 21:22:30','2017-01-06 04:47:08',1,0,'',NULL,NULL,NULL,NULL,NULL,''),(7,'About Us','1column','','','about-us','About Us','<div class=\"custom-page text-center\">\r\n    <div>\r\n        <span class=\"heading-3\">Catering to your requirements, handling your needs with care</span>\r\n        <p>Our store is more than just another average online retailer. We sell not only top quality products, but give our customers a positive online shopping experience. Forget about struggling to do everything at once: taking care of the family, running your business, walking your dog, cleaning the house, doing the shopping, etc. Purchase the goods you need every day or just like in a few clicks or taps, depending on the device you use to access the Internet. We work to make your life more enjoyable.</p>\r\n    </div>\r\n    <div class=\"skills row\">\r\n        <div class=\"col-xs-12 col-sm-4\">\r\n            <div class=\"value\"><span class=\"number\" data-finish=\"14500\">0</span></div>\r\n            <div class=\"term\">Products available</div>\r\n        </div>\r\n        <div class=\"col-xs-12 col-sm-4\">\r\n            <div class=\"value\"><span class=\"number\" data-finish=\"81\">0</span>%</div>\r\n            <div class=\"term\">Clients come back</div>\r\n        </div>\r\n        <div class=\"col-xs-12 col-sm-4\">\r\n            <div class=\"value\"><span class=\"number\" data-finish=\"10\">0</span> mlns</div>\r\n            <div class=\"term\">Site members</div>\r\n        </div>\r\n    </div>\r\n \r\n    <div class=\"section-title\">\r\n        <h2>Store events</h2>\r\n    </div>\r\n    <div class=\"row\">\r\n        <div class=\"col-xs-12 col-sm-4\">\r\n            <div class=\"material-icons-search big-circle-icon\"></div>\r\n            <h4 class=\"primary-color\">For convenience of choice</h4>\r\n            We think about the convenience of your choice. Our products are supplied with star rating that should help hesitant buyers to take a decision. What’s more, you can search our site if you know exactly what you are looking for or use a bunch of different filters that will considerably save your time and efforts.\r\n        </div>\r\n        <div class=\"col-xs-12 col-sm-4\">\r\n            <div class=\"material-icons-directions_car big-circle-icon\"></div>\r\n            <h4 class=\"primary-color\">Delivery to all regions</h4>\r\n            We deliver our goods worldwide. No matter where you live, your order will be shipped in time and delivered right to your door or to any other location you have stated. The packages are handled with utmost care, so the ordered products will be handed to you safe and sound, just like you expect them to be.\r\n        </div>\r\n        <div class=\"col-xs-12 col-sm-4\">\r\n            <div class=\"material-icons-thumb_up big-circle-icon\"></div>\r\n            <h4 class=\"primary-color\">The highest quality of products</h4>\r\n            We guarantee the highest quality of the products we sell. Several decades of successful operation and millions of happy customers let us feel certain about that. Besides, all items we sell pass thorough quality control, so no characteristics mismatch can escape the eye of our professionals.\r\n        </div>\r\n    </div>\r\n \r\n    <div class=\"section-title\">\r\n        <h2>Our team</h2>\r\n    </div>\r\n    <div class=\"team row\">\r\n        <div class=\"col-xs-12 col-sm-3\">\r\n            <figure><a href=\"#\" title=\"Robert Johnson\"><img src=\"{{view url=\'images/media/team1.jpg\'}}\" alt=\"Robert Johnson\"></a></figure>\r\n            <span class=\"heading-4\"><a href=\"#\" title=\"Robert Johnson\">ROBERT JOHNSON</a></span>\r\n            <div>Senior salesman with 15 years of experience. He knows everything about the products he offers.</div>\r\n        </div>\r\n        <div class=\"col-xs-12 col-sm-3\">\r\n            <figure><a href=\"#\" title=\"JESSICA PRISTON\"><img src=\"{{view url=\'images/media/team2.jpg\'}}\" alt=\"JESSICA PRISTON\"></a></figure>\r\n            <span class=\"heading-4\"><a href=\"#\" title=\"JESSICA PRISTON\">JESSICA PRISTON</a></span>\r\n            <div>Mega positive shop assistant always ready to help you make the right choice and charm you with a smile.</div>\r\n        </div>\r\n        <div class=\"col-xs-12 col-sm-3\">\r\n            <figure><a href=\"#\" title=\"SAM KROMSTAIN\"><img src=\"{{view url=\'images/media/team3.jpg\'}}\" alt=\"SAM KROMSTAIN\"></a></figure>\r\n            <span class=\"heading-4\"><a href=\"#\" title=\"SAM KROMSTAIN\">SAM KROMSTAIN</a></span>\r\n            <div>Wholesale manager. Contact him if you want to buy a batch of the products offered at our store.</div>\r\n        </div>\r\n        <div class=\"col-xs-12 col-sm-3\">\r\n            <figure><a href=\"#\" title=\"EDNA BARTON\"><img src=\"{{view url=\'images/media/team4.jpg\'}}\" alt=\"EDNA BARTON\"></a></figure>\r\n            <span class=\"heading-4\"><a href=\"#\" title=\"EDNA BARTON\">EDNA BARTON</a></span>\r\n            <div>Quality control manager. Her mission is to check the products we ship and settle quality issues if any.</div>\r\n        </div>\r\n    </div>\r\n \r\n    <div class=\"section-title\">\r\n        <h2>Testimonials</h2>\r\n    </div>\r\n    <div class=\"fa fa-quote-right medium-icon\"></div>\r\n    <div class=\"owl-testimonials testimonials  owl-carousel\">\r\n        <blockquote>\r\n            <cite>ROBERT JOHNSON</cite>\r\n            <q>Guys, you rock! Made a purchase at your store recently. The order has been shipped and delivered on time. The quality is superb! The price is quite reasonable. Told all my friends about your excellent service and the variety of choice. I think I’ll be your loyal customer in future as well. I wish your store many more years of prosperity.</q>\r\n        </blockquote>\r\n        <blockquote class=\"item\">\r\n            <cite>JESSICA PRISTON</cite>\r\n            <q>Having the distressing experience with some online shops before decided to say ‘’THANK YOU” to all personnel of this store. You are not only friendly, but deliver really good products in the shortest possible terms. In a word, I am absolutely happy with my purchase and the service. Everything was perfect!</q>\r\n        </blockquote>\r\n        <blockquote>\r\n            <cite>SAM KROMSTAIN</cite>\r\n            <q>Guys, you rock! Made a purchase at your store recently. The order has been shipped and delivered on time. The quality is superb! The price is quite reasonable. Told all my friends about your excellent service and the variety of choice. I think I’ll be your loyal customer in future as well. I wish your store many more years of prosperity.</q>\r\n        </blockquote>\r\n        <blockquote>\r\n            <cite>Edna Barton</cite>\r\n            <q>Having the distressing experience with some online shops before decided to say ‘’THANK YOU” to all personnel of this store. You are not only friendly, but deliver really good products in the shortest possible terms. In a word, I am absolutely happy with my purchase and the service. Everything was perfect!</q>\r\n        </blockquote>\r\n    </div>\r\n</div>\r\n\r\n','2016-03-11 21:25:42','2017-05-19 04:09:24',1,0,'',NULL,NULL,NULL,NULL,NULL,''),(8,'Template settings','1column','','','template-settings','Template Settings','<div class=\"custom-page\">\r\n    <h3><em>1. Home pages configurationn</em></h3>\r\n    <table class=\"data-table responsive\">\r\n        <thead>\r\n        <tr>\r\n                <th>#</th>\r\n                <th>Page Name</th>                  \r\n                <th>Page HTML (Content tab)</th>\r\n                <th>Page XML (Design tab)</th>\r\n                <th>Layout</th>\r\n        </tr>\r\n        </thead>\r\n        <tbody>\r\n            <tr>\r\n                <td>1.</td>\r\n                <td>Home Page</td>                      \r\n                <td>sources\\demo\\pages\\home_page.phtml</td>\r\n                <td>sources\\demo\\pages\\home_page.xml</td>\r\n                <td>1 column</td>                        \r\n            </tr>\r\n            <tr>\r\n                <td>2.</td>\r\n                <td>About  Us</td>                      \r\n                <td>sources\\demo\\pages\\about_us.phtml</td>\r\n                <td>NA</td>\r\n                <td>1 column</td>                      \r\n            </tr>\r\n            <tr>\r\n                <td>3.</td>\r\n                <td>Customer Service</td>                       \r\n           