r\n<script>\r\nvar headertext = [];\r\nvar headers = document.querySelectorAll(\"table.data-table thead\");\r\nvar tablebody = document.querySelectorAll(\"table.data-table tbody\");\r\n\r\nfor (var i = 0; i < headers.length; i++) {\r\n    headertext[i]=[];\r\n    for (var j = 0, headrow; headrow = headers[i].rows[0].cells[j]; j++) {\r\n      var current = headrow;\r\n      headertext[i].push(current.textContent);\r\n      }\r\n} \r\n\r\nfor (var h = 0, tbody; tbody = tablebody[h]; h++) {\r\n    for (var i = 0, row; row = tbody.rows[i]; i++) {\r\n      for (var j = 0, col; col = row.cells[j]; j++) {\r\n        col.setAttribute(\"data-th\", headertext[h][j]);\r\n      } \r\n    }\r\n}\r\n</script>','2016-03-11 21:26:35','2017-05-24 22:59:59',1,0,'',NULL,NULL,NULL,NULL,NULL,''),(9,'Shipping & Delivery','1column','','','shipping-delivery','Shipping & Delivery','<div class=\"shipping-delivery-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2\">\r\n        <p>\r\n            So you’ve done your shopping; just how long will it be till you can rock that swanky new Axolotl-themed laptop skin? The calculator below will give you the average amount of days it takes to ship a product to your door and the best time to contact our support team. Please note that every order at Redbubble is custom printed just for you, and will take 1-3 business days to print prior to shipping.\r\n        </p>\r\n        <span class=\"heading-3\">Here are a few things to consider while you wait for your order:</span>\r\n        <ul>\r\n            <li><span>We ship in business days. Monday - Friday, excluding national holidays.</span></li>\r\n            <li><span>Shipping starts from the date you received the “Your Order Has Shipped!” email.</span></li>\r\n            <li><span>The estimate above does not include manufacturing time - we need 1-3 business days to make sure your custom order is everything you hoped it would be.</span></li>\r\n        </ul>\r\n        <p>\r\n            Redbubble is a global company - we work with production and shipping partners all over the world to get your things to your doorstep, wherever that may be. Although the vast majority of our customers will get their orders by the day listed above, actual timeframes may vary from region to region.\r\n        </p>\r\n        <div class=\"shipping-delivery-page__border\">\r\n            <span class=\"heading-3\">So when do you contact Redbubble?</span>\r\n            <span>The calculator above lets you know the best time to message us. When that day rolls around.</span>\r\n            <span>Even if your order hasn’t arrived by the listed date, it’s probably still on its way (and worth the wait).</span>\r\n        </div>\r\n        <ol class=\"shipping-delivery-page__list\">\r\n            <li>\r\n                <span class=\"heading-3 shipping-delivery-page_shipping-icon\">How much is shipping?</span>\r\n                <p>Once you’ve clicked through to Secure Checkout, you can enter your delivery address and choose a shipping method. Shipping costs are then calculated and tacked on to your subtotal at the bottom of the page.</p>\r\n            </li>\r\n            <li>\r\n                <span class=\"heading-3 shipping-delivery-page_track-icon\">Can I track my order?</span>\r\n                <p>We rely on a global network of shipping partners (UPS, FedEx, DHL) as well as local postal services (USPS) to get your order to your doorstep as soon as possible. For this reason, tracking is not always available. If your order is being sent by a trackable service, these details will be included on your orders page as well as on the shipping email we send you.</p>\r\n            </li>\r\n            <li>\r\n                <span class=\"heading-3 shipping-delivery-page_order-icon\">Where does my order ship from?</span>\r\n                <p>We rely on a global network of shipping partners (UPS, FedEx, DHL) as well as local postal services (USPS) to get your order to your doorstep as soon as possible. For this reason, tracking is not always available. If your order is being sent by a trackable service, these details will be included on your orders page as well as on the shipping email we send you.</p>\r\n            </li>\r\n        </ol>\r\n    </div>\r\n</div>','2016-09-29 20:54:35','2017-01-06 04:48:23',1,0,'',NULL,NULL,NULL,NULL,NULL,''),(10,'FAQ','1column','','','faq','FAQ','<div class=\"faq-page row\">\r\n    <div class=\"col-md-8 col-md-preffix-2\">\r\n        <div id=\"faq-accordion\">\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>Is it necessary for me to register an account in order to buy an item?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s delivery status</li>\r\n                        <li>- changing or canceling the order</li>\r\n                        <li>- using your previous purchase history to become eligible for a Loyal Customer\'s discount</li>\r\n                    </ul>\r\n                  </div>                \r\n            </div>\r\n            <div class=\"accordion-block close\">\r\n                <div class=\"accordion-trigger close\">\r\n                    <span>Which shipping providers do you use?</span>\r\n                </div>\r\n                <div class=\"accordion-content\">\r\n                    <p> Yes and this is made with your own convenience in mind.  By creating (or using) an account during the  purchasing process you will have 3 things made so much easier for yourself:</p>\r\n                    <ul>\r\n                        <li>- keeping track of your order\'s