INSERT INTO `tm_blog_comment` VALUES (1,1,1,'Bernard Show',NULL,'Completely agree with the author. Modern businessmen should involve young people, introduce brands to them, socialize… Looks like a fresh product market!\r\n','2016-10-14 07:00:00','2016-10-14 14:18:11'),(2,1,1,'Bernard Show',NULL,'The author did a great job with all these research work. Really valuable information, thank you!','2016-10-14 07:00:00','2016-10-14 14:18:29'),(3,3,1,'James Anderson',NULL,'Follow your dream and it will turn to reality. A very inspiring article. Thanks for sharing!','2016-10-27 07:00:00','2016-10-14 14:18:49'),(4,3,1,'James Anderson',NULL,'I thought I am just a dreamer, but now I know how to become a doer. That’s cool, appreciate it!','2016-10-20 07:00:00','2016-10-14 14:19:10'),(5,4,1,'Grey',NULL,'Will try to repeat your mantras every day. Hopefully they will help in my current project.','2016-10-21 07:00:00','2016-10-14 14:19:32');
