INSERT INTO `tm_blog_post` VALUES (1,1,'establishing-your-brand-on-college-campuses','Establishing Your Brand on College Campuses',NULL,'Bernard Show','<p>Many students are cash-strapped, nowadays. Nevertheless, their purchasing power is very high. Research reveals that 20 million students in the US have a combined disposable income of $417 billion.  Moreover, another survey of students\' parents reveals that students now make 70 percent of their purchases themselves. These purchases are often made on credit cards. Therefore, students often have a significantly higher purchasing power.</p>\r\n<p>If you know this, you can utilize it to capture the attention of the 16-24 age demographic. However, it is essential for your product or service to appeal to the lifestyle of the students. Additionally, student ambassadors should be utilized to spread the word about your product or service to their friends and classmates.</p>\r\n<p>If you have not yet considered this demographic, it is time to reach out to them now!\r\nSocial media is a popular method for socialization and communication between many young people. Students are the majority users of social networking sites like Facebook and Twitter. These are the right places to introduce brands to young people.It is probably the right place to introduce a brand to them. To capture the student audience, it is essential to be a part of the conversation; it is also important to keep them engaged. Social media is the ideal platform for this.</p>\r\n<p>However, studies state that half of these social media savvy youngsters fail to follow brands on social networking sites. Students who do follow often only show temporary, marginal support. Social media is definitely a great platform for engaging students and spreading the word. However, it is definitely not the best for brand introduction and recognition.</p>','Many students are cash-strapped, nowadays. Nevertheless, their purchasing power is very high. Research reveals that 20 million students in the US have a combined disposable income of $417 billion.',NULL,NULL,'2016-10-26 13:00:00','2017-01-19 05:45:31',NULL,1),(2,1,'many-students-are-cash-strapped','Many students are cash-strapped',NULL,'Grey','<p>If you know this, you can utilize it to capture the attention of the 16-24 age demographic. However, it is essential for your product or service to appeal to the lifestyle of the students. Additionally, student ambassadors should be utilized to spread the word about your product or service to their friends and classmates.</p>\r\n\r\n<p>Many students are cash-strapped, nowadays. Nevertheless, their purchasing power is very high. Research reveals that 20 million students in the US have a combined disposable income of $417 billion. Moreover, another survey of students\' parents reveals that students now make 70 percent of their purchases themselves. These purchases are often made on credit cards. Therefore, students often have a significantly higher purchasing power.</p>\r\n\r\n<p>If you have not yet considered this demographic, it is time to reach out to them now!</p>\r\n\r\n<p>Social media is a popular method for socialization and communication between many young people. Students are the majority users of social networking sites like Facebook and Twitter. These are the right places to introduce brands to young people.It is probably the right place to introduce a brand to them. To capture the student audience, it is essential to be a part of the conversation; it is also important to keep them engaged. Social media is the ideal platform for this.</p>\r\n<p>However, studies state that half of these social media savvy youngsters fail to follow brands on social networking sites. Students who do follow often only show temporary, marginal support. Social media is definitely a great platform for engaging students and spreading the word. However, it is definitely not the best for brand introduction and recognition.</p>\r\n\r\nBernard Show: That’s awesome! Future belongs to youngsters, so businessmen can’t ignore their needs in any case.\r\n\r\nSarah Cole: The author did a great job with all these research work. Really valuable information, thank you!\r\n\r\nMichael Ventura: Completely agree with the author. Modern businessmen should involve young people, introduce brands to them, socialize… Looks like a fresh product market!\r\n','If you know this, you can utilize it to capture the attention of the 16-24 age demographic. However, it is essential for your product or service to appeal to the lifestyle of the students. ',NULL,NULL,'2016-10-14 07:00:00','2016-10-14 14:14:27',NULL,1),(3,1,'believe-in-the-business-of-your-dreams','Believe in the Business of Your Dreams',NULL,'Kate','<p>What is stopping you from believing in the business of your dreams? Insecurity? Fear? Lack of confidence? All of the above? How can you overcome these obstructions?</p>\r\n<p>Your Mantras</p>\r\n<p>You may be wondering if you have the necessary skills, time, connections, and a million other things in order to create the business of your dreams. If you let your uncertainty and insecurity overpower you, you won\'t ever be able to unleash your true business potential. To unlock the positive forces of your creativity and drive that will yield amazing results, make these your mantras:</p>\r\n<p>\'\'I will abandon all negative thoughts that prevent me from realizing my business objectives.\'\'\r\n\'\'I will focus my energy on growing the business of my dreams.\'\'</p>\r\n<p> A Dreamer and a Doer</p>\r\n<p>It is important to take time to develop your vision and your practical thinking should be geared to this vision. You need to work with conviction. Being a dreamer does not mean that you can\'t also be a doer. In fact, having a dream is the starting point for building your dream business. The problem starts when you stop there instead of setting realizable immediate targets. Success cannot come from one day to the next. So you need to build your dream business bit by bit. When your dreams begin to be transformed into reality thanks to your actions, you become aware of the power you possess for catalyzing success; and this further strengthens your determination to reach every single one of your business goals.</p>\r\n<p>Make It Happen</p>\r\n<p>Nothing can happen without tenacity, fortitude, and courage. Be bold enough to make choice  don\'t just let things happen to you. Though you cannot have control over everything, you can focus on what you can handle and influence with your actions in a given situation. You have the power to make decisions that will move your business forward. You should not feel daunted by your lack of knowledge of business strategies either. You learn and grow while building your business. No women entrepreneur/mompreneur possesses absolute knowledge; there are so many examples of hugely successful businesswomen who started out without having any clue about business promotion techniques. Their motivation to learn, their unwavering belief that they could create the business of their dreams, and their steadfastness were key factors for their success.</p>','What is stopping you from believing in the business of your dreams? Insecurity? Fear? Lack of confidence? All of the above? How can you overcome these obstructions',NULL,NULL,'2016-10-21 07:00:00','2016-10-14 14:15:00',NULL,1),(4,1,'your-mantras','Your Mantras',NULL,'Bernard Show','<p>You may be wondering if you have the necessary skills, time, connections, and a million other things in order to create the business of your dreams. If you let your uncertainty and insecurity overpower you, you won\'t ever be able to unleash your true business potential. To unlock the positive forces of your creativity and drive that will yield amazing results, make these your mantras:</p>\r\n<p>\'\'I will abandon all negative thoughts that prevent me from realizing my business objectives.\'\'\r\n\'\'I will focus my energy on growing the business of my dreams.\'\'</p>\r\n<p> A Dreamer and a Doer</p>\r\n<p>It is important to take time to develop your vision and your practical thinking should be geared to this vision. You need to work with conviction. Being a dreamer does not mean that you can\'t also be a doer. In fact, having a dream is the starting point for building your dream business. The problem starts when you stop there instead of setting realizable immediate targets. Success cannot come from one day to the next. So you need to build your dream business bit by bit. When your dreams begin to be transformed into reality thanks to your actions, you become aware of the power you possess for catalyzing success; and this further strengthens your determination to reach every single one of your business goals.</p>\r\n <p>Make It Happen</p>\r\n<p>Nothing can happen without tenacity, fortitude, and courage. Be bold enough to make choice  don\'t just let things happen to you. Though you cannot have control over everything, you can focus on what you can handle and influence with your actions in a given situation. You have the power to make decisions that will move your business forward. You should not feel daunted by your lack of knowledge of business strategies either. You learn and grow while building your business. No women entrepreneur/mompreneur possesses absolute knowledge; there are so many examples of hugely successful businesswomen who started out without having any clue about business promotion techniques. Their motivation to learn, their unwavering belief that they could create the business of their dreams, and their steadfastness were key factors for their success.</p>\r\n<p>What is stopping you from believing in the business of your dreams? Insecurity? Fear? Lack of confidence? All of the above? How can you overcome these obstructions?</p>','You may be wondering if you have the necessary skills, time, connections, and a million other things in order to create the business of your dreams. If you let your uncertainty and insecurity overpower you, you won\'t ever be able to unleash your true business potential.',NULL,NULL,'2016-10-24 07:00:00','2016-10-14 14:15:43',NULL,1),(5,1,'impact-the-heart-of-business','Impact - The Heart of Business',NULL,'Grey','<p>Thousands of people dream of having their own business and even more so be a successful entrepreneur. But what does it take to achieve success in the business industry?</p>\r\n\r\n\r\n<p>One of the most successful entrepreneurs featured at the Forbes website, Wendy Lipton - Dibner said that \"the success of your business would solely depend on you. The only thing you can rely on is your power to achieve your goal\"</p>\r\n\r\n<p>She shared her success story at the Forbes website and said that when she was young she learned a very important business objective from her high school activity and that is to go out, explore, come back and explain how money is made in business. This is an objective she never forgot until she made millions for herself.</p>\r\n\r\n\r\n<p>When she was already very successful, she never stopped understanding business and how it really works. Profit is the number one goal in business and how you make it is a natural talent. Yes, there may be a lot of guidelines given and showed on television and the internet but only you know how you will make your sales to the top.</p>\r\n\r\n\r\n<p>Try to ponder on these notes when thinking of a business:</p>\r\n\r\n\r\n<p>1.) Passion. Business may be set on profit but the core of your business should be something you love. Passion counts a lot in businesses because it also builds your determination in achieving your goal.</p>\r\n\r\n<p>2.) Impact. Business is a big and competitive world, what will matter is how you make a difference to your market. How your business will impact your market. The profit of your business will rely on the impact of your business. The mark it will leave to your customers will make it grow.</p>','Thousands of people dream of having their own business and even more so be a successful entrepreneur. But what does it take to achieve success in the business industry?',NULL,NULL,'2016-10-19 07:00:00','2016-10-14 14:16:17',NULL,1),(6,1,'three-guidelines','Three Guidelines',NULL,'Bernard Show','<p>When she was already very successful, she never stopped understanding business and how it really works. Profit is the number one goal in business and how you make it is a natural talent. Yes, there may be a lot of guidelines given and showed on television and the internet but only you know how you will make your sales to the top.</p>\r\n<p>Try to ponder on these notes when thinking of a business:</p>\r\n<p>1.) Passion. Business may be set on profit but the core of your business should be something you love. Passion counts a lot in businesses because it also builds your determination in achieving your goal.</p>\r\n<p>2.) Impact. Business is a big and competitive world, what will matter is how you make a difference to your market. How your business will impact your market. The profit of your business will rely on the impact of your business. The mark it will leave to your customers will make it grow.</p>\r\n<p>Thousands of people dream of having their own business and even more so be a successful entrepreneur. But what does it take to achieve success in the business industry?</p>\r\n<p>One of the most successful entrepreneurs featured at the Forbes website, Wendy Lipton - Dibner said that \"the success of your business would solely depend on you. The only thing you can rely on is your power to achieve your goal\"</p>\r\n\r\n<p>She shared her success story at the Forbes website and said that when she was young she learned a very important business objective from her high school activity and that is to go out, explore, come back and explain how money is made in business. This is an objective she never forgot until she made millions for herself.</p>','When she was already very successful, she never stopped understanding business and how it really works.',NULL,NULL,'2016-10-27 07:00:00','2016-10-14 14:16:49',NULL,1);
