INSERT INTO `tm_brand` VALUES (1,'Apple',1,'apple','Apple','brand-1.png','Apple_logo_black.svg.png','Apple_logo_black.svg.png','Apple is an American multinational technology company headquartered in Cupertino, California that designs, develops, and sells consumer electronics, computer software, and online services. The company\'s hardware products include the iPhone smartphone, the','Apple is an American multinational technology company headquartered in Cupertino, California that designs, develops, and sells consumer electronics, computer software, and online services. The company\'s hardware products include the iPhone smartphone, the iPad tablet computer, the Mac personal computer, the iPod portable media player, the Apple smartwatch, and the Apple TV digital media player. Apple\'s consumer software includes the macOS and iOS operating systems, the iTunes media player, the Safari web browser, and the iLife and iWork creativity and productivity suites. Its online services include the iTunes Store, the iOS App Store and Mac App Store, Apple Music, and iCloud.\r\n\r\nApple was founded by Steve Jobs, Steve Wozniak, and Ronald Wayne in April 1976 to develop and sell personal computers. It was incorporated as Apple Computer, Inc. in January 1977, and was renamed as Apple Inc. in January 2007 to reflect its shifted focus toward consumer electronics. Apple (NASDAQ: AAPL) joined the Dow Jones Industrial Average in March 2015.\r\nApple is the world\'s largest information technology company by revenue, the world\'s largest technology company by total assets, and the world\'s second-largest mobile phone manufacturer, by volume, after Samsung. In November 2014, Apple became the first U.S. company to be valued at over US$700 billion in addition to being the largest publicly traded corporation in the world by market capitalization. The company employs 115,000 full-time employees as of July 2015 and maintains 478 retail stores in seventeen countries as of March 2016. It operates the online Apple Store and iTunes Store, the latter of which is the world\'s largest music retailer. Consumers use more than one billion Apple products worldwide as of March 2016.','','',1),(2,'Samsung',1,'samsung','Samsung','brand-3.png','250px-Samsung_Logo.svg.png','250px-Samsung_Logo.svg.png','Samsung Group  is a South Korean multinational conglomerate headquartered in Samsung Town, Seoul. It comprises numerous affiliated businesses,most of them united under the Samsung brand, and is the largest South Korean chaebol (business conglomerate).','Samsung Group  is a South Korean multinational conglomerate headquartered in Samsung Town, Seoul. It comprises numerous affiliated businesses,most of them united under the Samsung brand, and is the largest South Korean chaebol (business conglomerate).\r\n\r\nSamsung was founded by Lee Byung-chul in 1938 as a trading company. Over the next three decades, the group diversified into areas including food processing, textiles, insurance, securities and retail. Samsung entered the electronics industry in the late 1960s and the construction and shipbuilding industries in the mid-1970s; these areas would drive its subsequent growth. Following Lee\'s death in 1987, Samsung was separated into four business groups – Samsung Group, Shinsegae Group, CJ Group and Hansol Group. Since 1990, Samsung has increasingly globalised its activities and electronics; in particular, its mobile phones and semiconductors have become its most important source of income.\r\n\r\nNotable Samsung industrial affiliates include Samsung Electronics (the world\'s 2nd largest information technology company measured by 2015 revenues, and 5th in market value), Samsung Heavy Industries (the world\'s 2nd largest shipbuilder measured by 2010 revenues), and Samsung Engineering and Samsung C&T (respectively the world\'s 13th and 36th largest construction companies). Other notable subsidiaries include Samsung Life Insurance (the world\'s 14th largest life insurance company), Samsung Everland (operator of Everland Resort, the oldest theme park in South Korea)and Cheil Worldwide (the world\'s 15th largest advertising agency measured by 2012 revenues).','','',1),(3,'Dell',1,'dell','Dell','brand-2.png','brand-2.png','brand-2.png','Dell Inc.  is a multinational computer technology company based in Round Rock, Texas and, along with Dell EMC, is a subsidiary of Dell Technologies, one of the largest technology companies in the world with 138,000 employees.','Dell Inc.  is a multinational computer technology company based in Round Rock, Texas and, along with Dell EMC, is a subsidiary of Dell Technologies, one of the largest technology companies in the world with 138,000 employees. Dell manufactures, sells, repairs, and supports personal computers (PCs), servers, data storage devices, network switches, computer software, computer peripherals, high-definition televisions, cameras, printers, and electronics built by other manufacturers. The company is well known for its innovations in supply chain management and e-commerce, particularly its direct-sales model and its \"build-to-order\" or \"configure to order\" approach to manufacturing—delivering individual PCs configured to customer specifications.','','',1),(4,'Intel',1,'intel','Intel','brand-4.png','brand-4.png','brand-4.png','Intel Corporation  is the world\'s largest and highest valued semiconductor chip makers based on revenue, and is the inventor of the x86 series of microprocessors: the processors found in most personal computers (PCs). Intel supplies processors for compute','Intel Corporation (also known as Intel, stylized as intel) is an American multinational corporation and technology company headquartered in Santa Clara, California (colloquially referred to as \"Silicon Valley\") that was founded by Gordon Moore (of Moore\'s law fame) and Robert Noyce. It is the world\'s largest and highest valued semiconductor chip makers based on revenue, and is the inventor of the x86 series of microprocessors: the processors found in most personal computers (PCs). Intel supplies processors for computer system manufacturers such as Apple, Lenovo, HP, and Dell. Intel also manufactures motherboard chipsets, network interface controllers and integrated circuits, flash memory, graphics chips, embedded processors and other devices related to communications and computing.','','',1),(5,'Lenovo',1,'lenovo','Lenovo','brand-5.png','brand-5.png','brand-5.png','Lenovo Group Ltd. designs, develops, manufactures and sells personal computers, tablet computers, smartphones, workstations, servers, electronic storage devices, IT management software, and smart televisions. ','Lenovo Group Ltd. or Lenovo PC International or shortened as Lenovo (/lɛnˈoʊvoʊ/, leh-no-voh), (formerly stylized as lenovo) is a Chinese multinational technology company with headquarters in Beijing, China. It designs, develops, manufactures and sells personal computers, tablet computers, smartphones, workstations, servers, electronic storage devices, IT management software, and smart televisions. Since 2013, Lenovo is the world\'s largest personal computer vendor by unit sales. It markets the ThinkPad line of notebook computers, IdeaPad and Yoga lines of notebook laptops, and the IdeaCentre and ThinkCentre lines of desktops.','','',1),(6,'HP',1,'hp','Hewlett-Packard Company','brand-6.png','brand-6.png','brand-6.png','The Hewlett-Packard Company was founded in a one-car garage in Palo Alto by William \"Bill\" Redington Hewlett and David \"Dave\" Packard, and initially produced a line of electronic test equipment. HP was the world\'s leading PC manufacturer from 2007 to Q2 2','The Hewlett-Packard Company (commonly referred to as HP) or shortened to Hewlett-Packard (/ˈhjuːlɪt ˈpækərd/ hew-lit pack-erd) was an American multinational information technology company headquartered in Palo Alto, California. It developed and provided a wide variety of hardware components as well as software and related services to consumers, small- and medium-sized businesses (SMBs) and large enterprises, including customers in the government, health and education sectors.\r\n\r\nThe company was founded in a one-car garage in Palo Alto by William \"Bill\" Redington Hewlett and David \"Dave\" Packard, and initially produced a line of electronic test equipment. HP was the world\'s leading PC manufacturer from 2007 to Q2 2013, after which Lenovo came to rank ahead of HP.[1][2][3] It specialized in developing and manufacturing computing, data storage, and networking hardware, designing software and delivering services. Major product lines included personal computing devices, enterprise and industry standard servers, related storage devices, networking products, software and a diverse range of printers and other imaging products. HP marketed its products to households, small- to medium-sized businesses and enterprises directly as well as via online distribution, consumer-electronics and office-supply retailers, software partners and major technology vendors. HP also had services and consulting business around its products and partner products.','','',1),(7,'Acer',1,'acer','Acer','brand-7.png','brand-7.png','brand-7.png','Acer Inc. is a Taiwanese multinational hardware and electronics corporation specializing in advanced electronics technology and is headquartered in Xizhi, New Taipei City, Taiwan.','Acer Inc. : Hóngqí Gǔfèn Yǒuxiàn Gōngsī, lit. Hongqi Corporation Ltd.; commonly known as Acer, stylised as acer, or formerly as acer & AceR) is a Taiwanese multinational hardware and electronics corporation specializing in advanced electronics technology and is headquartered in Xizhi, New Taipei City, Taiwan. Acer\'s products include desktop PCs, laptop PCs (Which can be further subdivided into clamshell, 2-in-1, convertible and Chromebook), tablets, servers, storage devices, Virtual Reality devices, displays, smartphones and peripherals. Acer also sells gaming PCs and accessories under its Predator sub brand. In the early 2000s, Acer implemented a new business model, shifting from a manufacturer to a designer, marketer and distributor of products, while performing production processes via contract manufacturers. In 2015, Acer was the sixth-largest personal computer vendor in the world. Currently, in addition to its core IT products business, Acer also has a new business entity that focuses on the integration of cloud services and platforms, and the development of smartphones and wearable devices with value-added IoT applications.','','',1),(8,'Windows',1,'windows','Microsoft Windows','brand-8.png','brand-8.png','brand-8.png','Microsoft Windows is a metafamily of graphical operating systems developed, marketed, and sold by Microsoft. It consists of several families of operating systems, each of which cater to a certain sector of the computing industry with the OS typically asso','Microsoft Windows, or simply Windows, is a metafamily of graphical operating systems developed, marketed, and sold by Microsoft. It consists of several families of operating systems, each of which cater to a certain sector of the computing industry with the OS typically associated with IBM PC compatible architecture. Active Windows families include Windows NT and Windows Embedded; these may encompass subfamilies, e.g. Windows Embedded Compact (Windows CE) or Windows Server. Defunct Windows families include Windows 9x, Windows Mobile and Windows Phone.\r\n\r\nMicrosoft introduced an operating environment named Windows on November 20, 1985, as a graphical operating system shell for MS-DOS in response to the growing interest in graphical user interfaces (GUIs). Microsoft Windows came to dominate the world\'s personal computer (PC) market with over 90% market share, overtaking Mac OS, which had been introduced in 1984. Apple came to see Windows as an unfair encroachment on their innovation in GUI development as implemented on products such as the Lisa and Macintosh (eventually settled in court in Microsoft\'s favor in 1993). On PCs, Windows is still the most popular operating system. However, in 2014, Microsoft admitted losing the majority of the overall operating system market to Android, because of the massive growth in sales of Android smartphones. In 2014, the number of Windows devices sold was less than 25% that of Android devices sold. This comparison however may not be fully relevant, as the two operating systems traditionally target different platforms.','','',1);
